import Footer from "./Components/Footer";
import Navbar from "./Components/Navbar";
import Home from "./Routes"


function App() {
  return (
      <div className="App">
          <Navbar/>
          <Routes>
            <Route path={routes.home} element={<Home/>}/>
          </Routes>
          <Footer/>
      </div>
  );
}

export default App;
